webpackJsonp([0x84283791086e],{7351:function(e,a){e.exports={data:{post:{html:'<p>The German Blogosphere is <a href="http://blogg.de/search.php?search=spreeblick+verlag">all a twitter</a> about the new weblog network <a href="http://www.spreeblick.com/2005/06/11/spreeblick-verlag-kg-gegrundet/" title="Spreeblick Verlag KG gegrundet">Spreeblick Verlag KG</a> founded this weekend, with weblogs concentrating on <a href="http://www.trashkurs.de/">music</a>, <a href="http://d-frag.de/">games</a>, <a href="http://www.lautgeben.de/">poltics</a>, <a href="http://www.antifreeze.de/">culture</a>, and <a href="http://www.zoomo.de/">broadcasting</a>, with even a <a href="http://focus.msn.de/magazin/magazin/heft24?page=7" title="Rebellen mit gutem Grund Heft 24 Focus Magazin Magazin & TV FOCUS Online in Kooperation mit MSN">mention in tomorrows Focus magazine</a> (as in dead-tree glossy paper).  Does this mean that weblogs are selling out? No, I think that progress is good, and that any organization with a <a href="http://www.suburbias.com/punk/ramones/ly/ramlyhappy.htm" title="We\'re A Happy Family">tag line from the Ramones</a> must be off to a good start. Now we just need a second German weblog network, so we can have catfights just like <a href="http://calacanis.weblogsinc.com/" title="The Jason Calacanis Weblog - calacanis.weblogsinc.com">Calcanis</a> and <a href="http://www.nickdenton.org/" title="Nick Denton">Denton</a>.</p>',fields:{title:"We're A Happy Family",date:"12 Jun 2005",url:"https://papascott.de/2005-06-12-were-a-happy-family/"}}},pathContext:{slug:"/2005-06-12-were-a-happy-family/",prev:{fields:{title:"A Rose From Christopher",date:"12 Jun 2005",slug:"/2005-06-12-a-rose-from-christopher/"}},next:{fields:{title:"Oral Exams",date:"13 Jun 2005",slug:"/2005-06-13-oral-exams/"}}}}}});
